import React, {useState, useEffect} from 'react';
import styled from 'styled-components';


const Styles = styled.div``;

function SearchResult(props){
    return(
        <React.Fragment>
            <Styles>
           <h1>Search result</h1>
            </Styles>
        </React.Fragment>
    )
}

export default SearchResult;

